targets.query:
import "strings"

from(bucket: "officialgazette")
  |> range(start: 2024-08-01, stop: 2024-08-31)
  |> filter(fn: (r) => r._measurement == "publication")
  |> filter(fn: (r) => r.cantons == "\"ZH\"")
  |> map(fn: (r) => ({
      r with 
      displayName: strings.replaceAll(v: r.displayName, t: ",", u: "")  // Remove commas
  }))
  |> map(fn: (r) => ({
      r with 
      displayName: strings.replaceAll(v: r.displayName, t: "\"", u: ""),  // Remove double quotes
      subRubric: strings.replaceAll(v: r.subRubric, t: "\"", u: "")  // Remove double quotes
  }))
  |> map(fn: (r) => ({
      r with 
      combinedLabel: r.displayName + " - " + r.subRubric
  }))
  |> filter(fn: (r) => contains(value: r.combinedLabel, set: strings.split(v: "${erfasserAndSubRubric:csv}", t: ",")))
  |> keep(columns: ["combinedLabel", "_time", "_value"]) 
  |> group(columns: ["combinedLabel"])
  |> aggregateWindow(every: 1d, fn: count, createEmpty: false)
  |> yield(name: "combinedLabel count per day")

