  |> filter(fn: (r) => r._measurement == "publication")
  |> filter(fn: (r) => r.cantons == "\"ZH\"")
  |> keep(columns: ["displayName", "subRubric"])
  |> group(columns: ["displayName", "subRubric"])  // Group by both fields
  |> distinct()  // This works on all the grouped columns
  |> map(fn: (r) => ({
      _value: r.displayName + " - " + r.subRubric
  }))
  |> map(fn: (r) => ({
      _value: strings.replaceAll(v: r._value, t: "\"", u: "")  // Remove double quotes
  }))

